import React from 'react';
import { Link } from 'react-router-dom';
import './LandingPage.css';

// Use a free course management system illustration from Flaticon
const cmsImage = process.env.PUBLIC_URL + '/assets/cms-illustration.svg';

const LandingPage = () => {
  return (
    <div className="landing-wrapper">
      <nav className="navbar">
        <div className="nav-logo">CMS</div>
        <div className="nav-links">
          <Link to="/" className="active">Home</Link>
          <Link to="#about">About</Link>
          <Link to="#contact">Contact</Link>
        </div>
      </nav>

      <div className="landing-main">
        <div className="landing-left">
          <h1><span>MANAGE</span><br />YOUR COURSES</h1>
          <p>Streamline your course management with our powerful<br />and intuitive platform.</p>
          <div className="landing-buttons">
            <button className="btn-outline">GET STARTED</button>
            <button className="btn-filled">LEARN MORE</button>
          </div>
        </div>
        <div className="landing-right">
          <img src={cmsImage} alt="Course Management System Illustration" className="cms-illustration" onError={(e) => {
            e.currentTarget.style.display = 'none';
          }} />
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
